import React, { useState, useEffect } from 'react';




const Card = ({ apiKey }) => {
    const [data, setData] = useState([]);

    useEffect(() => {
        fetch("https://api.data.gov.in/resource/93b75aee-8eed-4fd5-913f-8284ffe733e8?api-key=579b464db66ec23bdd0000014b84e48eb46245546655637612696e29%20&format=json&limit=10", {
            mode: "no-cors",
            headers: {
                'Authorization': `Bearer ${apiKey}`
            },

        })
            .then(response => response.json())
            .then(data => setData(data))
            .catch(error => console.log(error));
    }, [apiKey]);

    return (

        <div className="card">
            <div className="card-body">
                <h5 className="card-title">{data.title}</h5>
                <h6 className="card-subtitle mb-2 text-muted">{data.subtitle}</h6>
                <p className="card-text">{data.description}</p>
            </div>
        </div>

    );
}

export default Card;
